import React from 'react'

function FileList(props) {
  const post = props.post;
  return (
    <div>
      <ul>
        <li>symbol</li>
        {post?.map(post => <li>{post.symbol}</li>)}
      </ul>
      <ul>
        <li>priceChange</li>
        {post?.map(post => <li>{post.priceChange}</li>)}
        <li>priceChangePercent</li>
        {post?.map(post => <li>{post.priceChangePercent}</li>)}
      </ul>
    </div>
  )
}

export default FileList
